Step-by-step reasoning:

1. Key psychological mechanisms: Responders care about both the absolute monetary offer (split_self) and how that offer compares to a fairness benchmark. The fairness benchmark is derived from their token contribution relative to the total tokens (token_self divided by [token_self + token_opp]) multiplied by the combined_earning. Thus, responders experience a bonus when the received amount exceeds this benchmark and a penalty when it falls short.

2. Mechanism interactions: The utility is formed as an additive combination of the direct monetary offer and a fairness adjustment. The fairness adjustment is modeled as a logarithmic transformation of the ratio between the observed offered share (split_self) and the fairness benchmark (r). This logarithmic transformation captures proportional deviations (i.e. if the offer is much lower than fair, the log will be substantially negative; if the offer is much higher, it will be positive). A learnable sensitivity parameter (lambda) scales this fairness component, while a baseline parameter (mu) captures an inherent bias.

3. Mathematical form: Define r = combined_earning × (token_self/(token_self+token_opp)), then calculate the utility as:
  U = mu + split_self + lambda × r × ln(split_self/r)
This form ensures that when the offer exactly equals the fair benchmark (split_self = r), the log term is zero and U = mu + split_self. When split_self is below r, ln(split_self/r) is negative (penalty) and when above r it is positive (bonus). The two learnable parameters (mu and lambda) control baseline utility and fairness sensitivity respectively.

4. Calibration parameters: 
  – mu (baseline utility) with generous bounds (e.g. between –100 and 100) 
  – lambda (fairness sensitivity) with bounds (e.g. [0.001, 10])
These bounds are generous and finite in order to aid parameter recovery and mitigate collinearity issues.

5. Mapping to observable behavior:
  – split_self, token_self, token_opp, and combined_earning come directly from the dataset.
  – The fairness benchmark r is computed from these data variables.
  – The computed utility U for responder acceptance (used to later generate choice probabilities through an external temperature parameter) captures whether an offer is attractive (positive U) or unattractive (negative U).

Below is the formal specification.

<MODEL>
Let r = combined_earning × (token_self / (token_self + token_opp))  
U = mu + split_self + lambda × r × ln(split_self / r)
</MODEL>

